import Comment from './components/Comment';
import './App.scss';

class App extends Component{

  render(){
    return (
      <>
      <Header />
      <Video video={video[0]} />
      <Bio text={video[0]}/>
      <Comment comment={video[0]} />
     </>

    );
  }

}

export default App;
